import image from '../images/logo.png'

function Navbar() {
    return(
        <div>
            <ul>
                <a><img src={image} alt="logo"/></a>
                <li></li>
                <li></li>
                <li></li>
            </ul>
        </div>
    );
}

export default Navbar;
